import './App.css';
import categoryList from './fake-data/all-categories';

function Categories() {
  return categoryList.map((categoryName) => <Category item={categoryName} />);
}

function Category({ item }) {
  return <span className='categories-item'>{item}</span>;
}

function App() {
  return (
    <div className="App">
      <Categories />
    </div>
  );
}

export default App;
